import Footer from "./parts/Footer";
import BooksContainer from "./parts/BooksContainer";
import EbooksContainer from "./parts/EbooksContainer";

function App() {
    return (
        <>
        <HashRouter>
            <Nav/>
            <Switch>
                <Route exact path={"/"} component={Main} />
            </Switch>
        </HashRouter>
           <Footer/>
        </>
)
}
export default App;
